Join Green Bay Packers left tackle David Bakhtiari as he co-hosts Clubhouse Live, Gannett Wisconsin Media's live weekly pro football show Monday at 6:30 p.m. from The Clubhouse Sports Pub & Grill in downtown Appleton. 
Bakhtiari will bring a masked, mystery teammate guest to our special Halloween episode, and they’ll look ahead to the Packers’ Week 8 showdown against the Broncos through a fun and interactive discussion with co-hosts Brett Christopherson and Ricardo Arguello. Read or Share this story: http://pck.rs/1N1H8dP MORE STORIES
